import React,{Component} from "react"
import Appbar from 'muicss/lib/react/appbar';
import logo from '../images/logo.png';
import iconsearch from '../images/iconsearch.png';
import userbar from '../images/userbar.png';


class UserAppBar extends Component{
    render(){
    let appbar={backgroundColor: '#1776B0'};
        return (
            <Appbar style={appbar} >

<div className="container"  >
<div className="row" >
    <div className="col-md-1" >

    </div>
    <div className="col-md-10">

    <nav class="navbar navbar-expand-lg "> <a class="navbar-brand" href="#" data-abc="true"> <img src={logo} width='100px'/></a> <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarColor02" aria-controls="navbarColor02" aria-expanded="false" aria-label="Toggle navigation"> <span class="navbar-toggler-icon"></span> </button>
    <div class="collapse navbar-collapse" id="navbarColor02" style={{color:"#ffffff"}}>
    <form class="form-inline  my-lg-0"> <input class="form-control form-control-sm mr-sm-2" style={{height:"25px",width:"300px"}}  type="text" placeholder="Search your favorite"/> <button class="btn btn-light btn-sm my-2 my-sm-2" style={{height:"25px"}} type="submit"><img src={iconsearch} width="18px" style={{marginBottom:"6px"}} height="18px"/></button> </form>
        <ul class="navbar-nav mr-auto" >
            <li class="nav-item active" > <a class="nav-link" href="#" data-abc="true"><font color="#ffffff">Home</font></a> </li>
            <li class="nav-item" style={{color:"#ffffff"}}> <a class="nav-link" href="#" data-abc="true"><font color="#ffffff">Market</font></a> </li>
            <li class="nav-item" style={{color:"#ffffff"}}> <a class="nav-link" href="#" data-abc="true"><font color="#ffffff">Find</font></a> </li>
            <li class="nav-item" style={{color:"#ffffff"}}> <a class="nav-link" href="#" data-abc="true"><font color="#ffffff">Discover</font></a> </li>
            <li class="nav-item" style={{color:"#ffffff"}}> <a class="nav-link" href="#" data-abc="true"><font color="#ffffff">Recruit</font></a> </li>
            <li class="nav-item" style={{color:"#ffffff"}}> <a class="nav-link" href="#" data-abc="true"><img src={userbar} width="30px" height="30px" /></a> </li>
        </ul>

    </div>
</nav>


    </div>
    <div className="col-md-1">

    </div>
</div>
</div>
            </Appbar>
          );
    }
}

export default UserAppBar
